    [],nt"num_tags": 5,nt"name": "narrative-report-crescent-lake-national-wildlife-refuge-period-ending-april-30-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1950. The report begins by summarizing the weather conditions and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments and plantings.
    The public relations section of the report describes Refuge visitors. N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
